import './App.css';
import React, { Component } from 'react';
import Ingredient from './pages/ingredientPage';
import HomePage from './pages/homePage';
import FreezeBee from './pages/freezebeePage';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Fabrication from './pages/fabricationPage';
import { Navbar, NavbarBrand, Container, Image, Nav } from 'react-bootstrap';
import Logo from './assets/logo.png';
import NavbarToggle from 'react-bootstrap/esm/NavbarToggle';
import NavbarCollapse from 'react-bootstrap/esm/NavbarCollapse';

class App extends Component {
  render() {
    return (
        <Router>
          <Navbar fixed="top" collapseOnSelect expand="lg" bg="dark" variant="dark">
            <Container>
              <Image src={Logo} className="mx-2" alt="KillerBee" height="35"/>
              <NavbarBrand as={Link} to={'/'}>KillerBee</NavbarBrand>
              <NavbarToggle aria-controls="responsive-navbar-nav" />
              <NavbarCollapse className="justify-content-md-end" id="responsive-navbar-nav">
                <Nav>
                  <NavbarBrand as={Link} to={'/freezebee'}>Freezebee</NavbarBrand>
                  <NavbarBrand as={Link} to={"/fabrication"}>Fabrication</NavbarBrand>
                  <NavbarBrand as={Link} to={"/ingredient"}>Ingr√©dients</NavbarBrand>
                </Nav>
              </NavbarCollapse>
            </Container>
          </Navbar>
            <Switch>
              <Route exact path='/' component={HomePage} />
              <Route path='/ingredient' component={Ingredient} />
              <Route path='/freezebee' component={FreezeBee} />
              <Route path='/fabrication' component={Fabrication} />
            </Switch>
        </Router>
    );
  }
}

export default App;
